import React, { Component } from 'react';
import * as d3 from 'd3';
//import { Link } from 'react-router-dom';
import { Tab, Segment } from 'semantic-ui-react';
import './TabView.css';


class TabView extends Component {

    panes = [
        { 
            menuItem:   'Force Display', 
                        render: () => 
                            <Tab.Pane>
