                                    <li>Tea</li>
                                    <li>Milk</li>
                                    <li>Coffee</li>
                                    <li>Tea</li>
                                    <li>Milk</li>
                                </ul>  
                                </Segment>
                            </Tab.Pane> 
        },
        { 
            menuItem:   'Bar Display', 
                        render: () => 
                            <Tab.Pane>
                                <Segment >
                                    Bar Display
                                </Segment>
                            </Tab.Pane> 
        }
    ];

    force = () => {
        return (
            <div>
                <p>Force Display</p>
            </div>
        );
    }

    render () {

        return (
            <div>
                <Tab panes={this.panes} />
            </div>
        );
    }

}
export default TabView;

